pragma solidity 0.8.1;
pragma abicoder v2;

import "./interfaces/IAsset.sol";
import "./interfaces/IAssetSettings.sol";
import "./interfaces/ILpDeployer.sol";
import "./interfaces/IQLP.sol";
import "../Pool/interfaces/IPool.sol";
import "../interfaces/ICallback.sol";

import "../interfaces/IEventOut.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";


//
//LP PVE
contract Asset is IAsset{

    using SafeERC20 for ERC20;
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    mapping(uint32 => Position) public _positions;
    mapping(uint32 => RemoveInfo) public _removeInfos;
    mapping(uint32 => EpochInfo) public _epochInfos;

    address public _assetAddress;
    address public _settingAddress;
    uint256 public _liquidityAmount = 0;//
    address public _lp;
    uint32 public _positionIndex = 0;
    uint32 public _removeIndex = 0;
    uint32 public override _currentEpoch = 0;
    //
    uint256 public _applyRemoveLp = 0;
    // //LP
    // uint256 public _settleRemoveLp = 0;

    uint256 public constant StandardDecimal = 18;
    uint256 public override _precisionDiff;

    bool public unlocked = true;

    modifier lock() {
        require(unlocked, 'LOK');
        unlocked = false;
        _;
        unlocked = true;
    }

    constructor(address poolToken,address setting) {
        _assetAddress = poolToken;
        _settingAddress = setting;

        uint256 _poolDecimalDiff = StandardDecimal > ERC20(poolToken).decimals()
        ? StandardDecimal - ERC20(poolToken).decimals()
        : 0;
        if (_poolDecimalDiff > 0) {
            _precisionDiff = 10**_poolDecimalDiff;
        } else {
            _precisionDiff = 1;
        }
        _lp = ILpDeployer(IAssetSettings(_settingAddress).lpDeployer()).deployLP(_assetAddress,_settingAddress);
        // 
        // bytes memory data = abi.encode(_assetAddress,_settingAddress,_lp,address(this)ERC20(poolToken).decimals());
        // eventOut(1,data);
    }
    function userPayAsset(address payer,
        uint256 amount) internal {
        IERC20(_assetAddress).safeTransferFrom(payer,address(this),amount);
    }

    function userPayLp(address payer,
        uint256 amount) internal {
        IERC20(_lp).safeTransferFrom(payer,address(this),amount);

    }

    function tokenCallBack(address user,address tokenAddress, uint256 amount) internal lock {
        uint256 balanceBefore = IERC20(tokenAddress).balanceOf(address(this));
        ICallback(msg.sender).assetCallback(
            amount,
            tokenAddress,
            user
        );
        require(
            IERC20(tokenAddress).balanceOf(address(this)) >=
                balanceBefore.add(amount),
            "poolToken is not enough"
        );
    }

    function getLPAmount(uint256 assetAmount) internal view returns (uint256) {
        if (_liquidityAmount == 0) {
            return assetAmount;
        }
        return assetAmount.mul(IERC20(_lp).totalSupply()).div(_liquidityAmount);
    }

    function getAssetAmount(uint256 lpAmount) internal view returns (uint256) {
        return lpAmount.mul(_liquidityAmount).div(IERC20(_lp).totalSupply());
    }
    //applyLp
    function _liquidityPool() external override view returns(uint256) {
        uint256 lpToken = IERC20(_lp).totalSupply();
        return _liquidityAmount.mul(lpToken).div(lpToken.add(_applyRemoveLp));
    }


    function addLiquidity(address receipt,AmountIn calldata amountIn) external override{
        settleEpoch();
        require(amountIn.amount > 0,"invalid amountIn");
        if (amountIn.payType == 1) {
            userPayAsset(msg.sender,amountIn.amount);
        } else {
            tokenCallBack(amountIn.payerAddress,_assetAddress,amountIn.amount);
        }
        uint256 lpAmount = getLPAmount(amountIn.amount);
        _liquidityAmount = _liquidityAmount.add(amountIn.amount);

        IQLP(_lp).mint(receipt,lpAmount);
        bytes memory data = abi.encode(receipt,amountIn.amount,lpAmount);
        eventOut(2,data);

    }
    //liquidity
    function applyRemove(address receipt,AmountIn calldata amountIn) external override {
        settleEpoch();
        require(amountIn.amount > 0,"invalid amountIn");
        if (amountIn.payType == 1) {
            userPayLp(msg.sender,amountIn.amount);
        } else {
            tokenCallBack(amountIn.payerAddress,_lp,amountIn.amount);
        }
        IQLP(_lp).burn(address(this),amountIn.amount);
        _applyRemoveLp = _applyRemoveLp.add(amountIn.amount);
        uint32 outEpoch = IAssetSettings(_settingAddress).getOutEpoch(address(this));
        _removeIndex++;
        _removeInfos[_removeIndex] = RemoveInfo(
            msg.sender,
            receipt,
            amountIn.amount,
            outEpoch,
            _currentEpoch
        );
        // out
        EpochInfo memory epochData = _epochInfos[outEpoch];
        epochData.lpAmount = epochData.lpAmount.add(amountIn.amount);
        _epochInfos[outEpoch] = epochData;

        bytes memory data = abi.encode(_removeIndex,msg.sender,receipt,amountIn.amount,outEpoch,_currentEpoch,_applyRemoveLp,epochData.lpAmount);
        eventOut(7,data);
        //eventOutremoveIndex
    }
    //apply
    function cancleApplyRemove(uint32 removeIndex) external override {
        settleEpoch();
        require(_removeInfos[removeIndex].owner == msg.sender,"invalid caller");
        IQLP(_lp).mint(_removeInfos[removeIndex].owner,_removeInfos[removeIndex].lpAmount);
        if (_removeInfos[removeIndex].outEpoch >= _currentEpoch) {
            _applyRemoveLp = _applyRemoveLp.sub(_removeInfos[removeIndex].lpAmount);

            EpochInfo memory epochData = _epochInfos[_removeInfos[removeIndex].outEpoch];
            epochData.lpAmount = epochData.lpAmount.sub(_removeInfos[removeIndex].lpAmount);
            _epochInfos[_removeInfos[removeIndex].outEpoch] = epochData;  
        } else {
            require(false,"can not cancle");
        }

        bytes memory data = abi.encode(removeIndex,_removeInfos[removeIndex].lpAmount,_applyRemoveLp);
        eventOut(8,data);
        delete _removeInfos[removeIndex];

    }
    //lastTime   
    function settleEpoch() internal {
        EpochInfo memory epochData = _epochInfos[_currentEpoch];
        bytes memory data;
        // Start
        uint256 moveEpoch = IAssetSettings(_settingAddress).isNextEpoch(address(this),epochData.beginTime);
        if (moveEpoch == 0) {
            return ;
        }

        for (uint256 i = 0;i!=moveEpoch;i++) {
            epochData = _epochInfos[_currentEpoch];
            if (epochData.lpAmount != 0) {
                epochData.tokenAmount = epochData.lpAmount.mul(_liquidityAmount).div(_applyRemoveLp.add(IERC20(_lp).totalSupply()));
                if (epochData.beginTime == 0) {
                    epochData.beginTime = block.timestamp;
                    data = abi.encode(_currentEpoch,epochData.beginTime);
                    eventOut(10,data);
                }
                _applyRemoveLp = _applyRemoveLp.sub(epochData.lpAmount);
                _liquidityAmount = _liquidityAmount.sub(epochData.tokenAmount);
                _epochInfos[_currentEpoch] = epochData;    
                data = abi.encode(_currentEpoch,epochData.tokenAmount,_liquidityAmount);
                eventOut(9,data);  
            }
            _currentEpoch++;
            if (i > 3) {
                break;
            }
        }
        epochData = _epochInfos[_currentEpoch];
        epochData.beginTime = block.timestamp;
        _epochInfos[_currentEpoch] = epochData;  
        data = abi.encode(_currentEpoch,epochData.beginTime);
        eventOut(10,data);
    }

    function removeLiquidity(uint32 removeIndex) external override {
        settleEpoch();
        require(_removeInfos[removeIndex].owner == msg.sender || _removeInfos[removeIndex].receipt == msg.sender,"invalid caller");
        EpochInfo storage epoch = _epochInfos[_removeInfos[removeIndex].outEpoch];
        require(epoch.tokenAmount > 0,"no token out");
        uint256 tokenOut = epoch.tokenAmount.mul(_removeInfos[removeIndex].lpAmount).div(epoch.lpAmount);
        IERC20(_assetAddress).safeTransfer(_removeInfos[removeIndex].receipt,tokenOut); 
        delete _removeInfos[removeIndex];

        bytes memory data = abi.encode(removeIndex,msg.sender,tokenOut);
        eventOut(3,data);
    }
